import supertest from 'supertest';
import { expect } from 'chai';

const request = supertest('https://gorest.co.in/public-api/');

const Token =
    '2719e848f891dcc82938d0df6045b6bc6a735c4c641060d5015739aa58821f28';
describe('users',()=>{
    it('GET/Users',()=>{
        /* request.get(`users?access-token=${Token}`).end((err,res)=>{
            expect(res.body.data).to.not.be.empty;
            done();
        }); */
        return request.get(`users?access-token=${Token}`).then((res)=>{
            expect(res.body.data).to.not.be.empty;
        });
    });
    it('Get/Users/:id',()=>{
        return request.get(`users/11?access-token=${Token}`).then((res)=>{
            expect(res.body.data.id).to.be.eq(11);  
        });
    });
    it('Get/Users with query params',()=>{
        const url = `users?access-token=${Token}&page=5&gender=female&status=active`

        return request.get(url).then((res)=>{
            expect(res.body.data).to.not.be.empty;
            res.body.data.forEach((data)=>{
                expect(data.gender).to.be.eq('female');
                expect(data.status).to.be.eq('active');
            });
        });
    });
    it('POST/Users', () => {
        const data ={
            email:`testsample${Math.floor(Math.random()*999)}@gmail.com`,
            name:"James Howlett",
            gender:"male",
            status:"active"
        };
        return request
            .post('users')
            .set("Authorization",`Bearer ${Token}`)
            .send(data)
            .then((res)=>{
                data.gender='female';
                expect(res.body.data).to.deep.include(data);
        });
    });
    it('PUT/Users/:id', () => {
        const data={
            status:"active",
            gender:"female",
            name:`Victor_${Math.floor(Math.random()*999)}`
        }
        return request
        .put('users/154')
        .set("Authorization",`Bearer ${Token}`)
        .send(data).then((res)=>{
            expect(res.body.data).to.deep.include(data);
        })
    });
    it('DELETE/Users/:id', () => {
        return request
        .delete('users/154')
        .set("Authorization",`Bearer ${Token}`)
        .then(res=>{
            expect(res.body.data).to.be.eq(null);
        })
    });
});

